			var number;
			var cn;
			var sum = 0;
			var dv;
			var count;
			var multiplier;

			// Removing special characters from value
			value = value.replace(
				/([~!@#$%^&*()_+=`{}\[\]\-|\\:;'<>,.\/? ])+/g,
				""
			);

